CREATE DEFINER=`root`@`localhost` PROCEDURE `create_trip_seats_for_new_trips` ()   BEGIN
  DECLARE done INT DEFAULT FALSE;
  DECLARE v_trip_id INT;
  DECLARE v_vehicle_id INT;
  
  -- Cursor để lấy các trips chưa có trip_seats
  DECLARE cur CURSOR FOR 
    SELECT t.id, t.vehicle_id 
    FROM trips t 
    WHERE NOT EXISTS (
      SELECT 1 FROM trip_seats ts WHERE ts.trip_id = t.id
    )
    AND t.departure_time >= '2025-11-25';
    
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  
  OPEN cur;
  
