    SELECT 
      v_trip_id,
      s.id,
      s.seat_number,
      s.seat_type,
      'available',
      s.floor,
      s.row_position
    FROM seats s
    WHERE s.vehicle_id = v_vehicle_id;
    
  END LOOP;
  
  CLOSE cur;
END$$

